trailingComments.value:
*
   * Browse a podcast (Show) for episodes details
   * @param {object} options - Options object including the show ID
   * @example
   * let showOptions = {
   *   c: 'pbrowse',
   *   id: 'p191418'
   * };
   * let show = tunein.browse_show(showOptions);
   * show.then(function(results) {
   *   console.log(results);
   * });

